local expansionID = {
	classic = 1,
	tbc = 2,
	wrath = 3,
}


--[[
	this data will need to be cleaned, for now im using a simple check to see if the item was added before
]]
local itemsSeen = {}
local enchantsSeen = {}

addon.tradeskillItems = {};
for expansion, data in pairs(tradeskillItems) do

	for k, item in ipairs(data) do
		item.expansion = expansionID[expansion];

		if item.tradeskill == 333 then
			if not enchantsSeen[item.name] then
				table.insert(addon.tradeskillItems, item)
				enchantsSeen[item.name] = true
			end
		else
			if not itemsSeen[item.name] then
				table.insert(addon.tradeskillItems, item)
				itemsSeen[item.name] = true
			end
		end
	end
end


